  input: '"TEXT","F3XA",,"Regarding your letter dated December 17, 2003, the Fund
    includes a request for required donor information as required by federal law in
    every solicitation it does.  If a contribution is received without it, a written
    request for the information is sent within 30 days, along with a pre-addressed
    return envelope.  Any contributor information received as a result of the Fund''s
    best efforts is reported to the Commission either in an amended report or on the
    next report filed by the Fund.  With regard to the Fund''s administrative expenses,
    the Fund retains a law firm to administer the Fund.  The firm''s services include
    record-keeping, check writing, and preparation of the Fund''s FEC reports.  So
    the retainer includes those normal administrative expenses to which you refer.  Also,
    because all the record-keeping is done by the law firm, the Fund does not need
    an office.  The Fund''s mid-year report shows two payments for these services
    during this period, one on April 11, 2003 and the other on June 4, 2003."'
